import React from "react";
import { Link } from "react-router-dom";

import Navigation from "./BtnNavigation.jsx";

export default function ItemSlider(props) {
  const { slide, index, slides, currentSlide, setCurrentSlide } = props;

  console.log(slide);
  return (
    <>
      <div
        className={
          index === currentSlide ? "carousel-item active" : "carousel-item"
        }
      >
        <div className="content-slide">
          <div className="left">
            <h1>Slide {index}: Lorem ipsum dolor sit amet</h1>
            <p>
              Lorem ipsum dolor sit amet consectetur adipisicing elit. Corporis,
              veritatis et quasi ipsum quia repellendus dolorem provident,
              labore totam libero consequatur? Vero aut illum tempora,
              voluptatibus commodi perferendis quidem sit! lorem ipsum dolor,
              sit amet consectetur adipisicing elit. Quod, eveniet tempore
              nesciunt facilis inventore beatae quam fugit ducimus, voluptatibus
              enim aliquid necessitatibus officia perferendis dolor nulla
              adipisci corporis ad obcaecati?
            </p>

            <Link to="">Más Información</Link>
          </div>
          <div className="right">
            <Navigation
              currentSlide={currentSlide}
              setCurrentSlide={setCurrentSlide}
              data={slides}
            />
            <div className="cont-img">
              <div className="overlay">
                <div className="date">
                  <span>03</span>
                  <span>-22</span>
                </div>
              </div>

              <img src={slide} alt="" />
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
